cl/?p=197',0,'revision','',0),(198,1,'2022-12-27 14:15:36','2022-12-27 14:15:36','','SOC QUIMICA MINERA DE CHILE S.A. SERIE B','','inherit','closed','closed','','112-revision-v1','','','2022-12-27 14:15:36','2022-12-27 14:15:36','',112,'http://circum.cl/?p=198',0,'revision','',0),(199,1,'2022-12-27 14:16:07','2022-12-27 14:16:07','','SOCIEDAD DE INVERSIONES ORO BLANCO S.A.','','inherit','closed','closed','','106-revision-v1','','','2022-12-27 14:16:07','2022-12-27 14:16:07','',106,'http://circum.cl/?p=199',0,'revision','',0),(200,1,'2022-12-27 14:16:26','2022-12-27 14:16:26','','NITRATOS DE CHILE S.A.','','inherit','closed','closed','','103-revision-v1','','','2022-12-27 14:16:26','2022-12-27 14:16:26','',103,'http://circum.cl/?p=200',0,'revision','',0),(202,1,'2022-12-28 19:08:32','0000-00-00 00:00:00','','Borrador automático','','auto-draft','open','open','','','','','2022-12-28 19:08:32','0000-00-00 00:00:00','',0,'http://circum.cl/?p=202',0,'post','',0),(203,1,'2022-12-28 19:08:33','0000-00-00 00:00:00','','Borrador automático','','auto-draft','open','open','','','','','2022-12-28 19:08:33','0000-00-00 00:00:00','',0,'http://circum.cl/?p=203',0,'post','',0),(204,1,'2022-12-28 19:37:45','2022-12-28 19:37:45','<!-- wp:paragraph -->\n<p>Indicador ADX (Average Directional Index)<br>El ADX (Average Directional Index) es un indicador de análisis técnico, utilizado para conocer si los precios se encuentran en tendencia o en rango y para medir la fuerza de la tendencia.<br>Es un indicador de tipo oscilador no direccional, es decir, cuantifica la fortaleza de una tendencia independientemente de su dirección. En español ADX significa índice de dirección media. Es común utilizarlo junto con los indicadores direccionales de movimiento (DMI), que nos muestran la tendencia predominante del mercado.<br>Para un analista técnico es fundamental conocer cuál es la tendencia de los precios. Con el indicador ADX consigue medir la fortaleza de dicha tendencia. El ADX oscila entre 0 y 100 (al igual que el RSI) y se calcula según las diferencias entre DI+ y DI-. Estos indicadores técnicos fueron desarrollados por Welles Wilder en los años 80s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cómo utilizar el indicador ADX<br>Cuando el ADX es mayor que 30, el mercado se encuentra en una tendencia fuerte, cuando está entre 20 y 30 no está bien definido y cuando es menor a 20 indica que el mercado está en rango. Las formas más comunes de utilizar el ADX son:<br>Conocer la fuerza de una tendencia: Cuando el ADX tiene pendiente positiva y/o se sitúa en niveles entre 30 y 40 indica fortaleza de tendencia. En movimientos de tendencia fuerte (ya sea alcista o bajista) el especulador aprovecha las correcciones a la baja (en tendencia alcista) para comprar el valor y los rebotes (en tendencia bajista).<br>Para saber cuando un rango llega a su fin: Cuando el ADX se encuentra por debajo de 20-30 y/o se encuentra entre las líneas de movimiento direccional. Con los precios en rango, los especuladores compran en la parte inferior y venden en la superior, el ADX les permite saber cuando ese rango se termina. Además, la señal de que un rango termina significa que comienza una nueva tendencia, por lo que especulador solo tendrá que subirse a ésta.<br>Determinar cambios de tendencia: Cuando existen divergencias demasiado altas (por encima de 45-50) quiere decir que la tendencia se está agotando o está perdiendo fuerza. Por lo que probablemente se tome un respiro. Por el contrario, cuando estas divergencias se encuentran por encima de 30, pero en lecturas no muy altas entendemos que la tendencia se está fortaleciendo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://economipedia.com/definiciones/indicador-adx-average-directional-index.html\">https://economipedia.com/definiciones/indicador-adx-average-directional-index.html</a></p>\n<!-- /wp:paragraph -->','ADX','','publish','open','open','','adx','','','2022-12-28 19:37:47','2022-12-28 19:37:47','',0,'http://circum.cl/?p=204',0,'post','',0),(205,1,'2022-12-28 19:37:45','2022-12-28 19:37:45','<!-- wp:paragraph -->\n<p>Indicador ADX (Average Directional Index)<br>El ADX (Average Directional Index) es un indicador de análisis técnico, utilizado para conocer si los precios se encuentran en tendencia o en rango y para medir la fuerza de la tendencia.<br>Es un indicador de tipo oscilador no direccional, es decir, cuantifica la fortaleza de una tendencia independientemente de su dirección. En español ADX significa índice de dirección media. Es común utilizarlo junto con los indicadores direccionales de movimiento (DMI), que nos muestran la tendencia predominante del mercado.<br>Para un analista técnico es fundamental conocer cuál es la tendencia de los precios. Con el indicador ADX consigue medir la fortaleza de dicha tendencia. El ADX oscila entre 0 y 100 (al igual que el RSI) y se calcula según las diferencias entre DI+ y DI-. Estos indicadores técnicos fueron desarrollados por Welles Wilder en los años 80s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cómo utilizar el indicador ADX<br>Cuando el ADX es mayor que 30, el mercado se encuentra en una tendencia fuerte, cuando está entre 20 y 30 no está bien definido y cuando es menor a 20 indica que el mercado está en rango. Las formas más comunes de utilizar el ADX son:<br>Conocer la fuerza de una tendencia: Cuando el ADX tiene pendiente positiva y/o se sitúa en niveles entre 30 y 40 indica fortaleza de tendencia. En movimientos de tendencia fuerte (ya sea alcista o bajista) el especulador aprovecha las correcciones a la baja (en tendencia alcista) para comprar el valor y los rebotes (en tendencia bajista).<br>Para saber cuando un rango llega a su fin: Cuando el ADX se encuentra por debajo de 20-30 y/o se encuentra entre las líneas de movimiento direccional. Con los precios en rango, los especuladores compran en la parte inferior y venden en la superior, el ADX les permite saber cuando ese rango se termina. Además, la señal de que un rango termina significa que comienza una nueva tendencia, por lo que especulador solo tendrá que subirse a ésta.<br>Determinar cambios de tendencia: Cuando existen divergencias demasiado altas (por encima de 45-50) quiere decir que la tendencia se está agotando o está perdiendo fuerza. Por lo que probablemente se tome un respiro. Por el contrario, cuando estas divergencias se encuentran por encima de 30, pero en lecturas no muy altas entendemos que la tendencia se está fortaleciendo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://economipedia.com/definiciones/indicador-adx-average-directional-index.html\">https://economipedia.com/definiciones/indicador-adx-average-directional-index.html</a></p>\n<!-- /wp:paragraph -->','ADX','','inherit','closed','closed','','204-revision-v1','','','2022-12-28 19:37:45','2022-12-28 19:37:45','',204,'http://circum.cl/?p=205',0,'revision','',0),(206,1,'2022-12-29 15:26:32','0000-00-00 00:00:00','','Borrador automático','','auto-draft','closed','closed','','','','','2022-12-29 15:26:32','0000-00-00 00:00:00','',0,'http://circum.cl/?post_type=ticket&p=206',0,'ticket','',0),(207,1,'2022-12-29 15:27:37','0000-00-00 00:00:00','','Borrador automático','','auto-draft','closed','closed','','','','','2022-12-29 15:27:37','0000-00-00 00:00:00','',0,'http://circum.cl/?post_type=ticket&p=207',0,'ticket','',0),(216,1,'2022-12-29 15:54:28','0000-00-00 00:00:00','','Borrador automático','','auto-draft','closed','closed','','','','','2022-12-29 15:54:28','0000-00-00 00:00:00','',0,'http://circum.cl/?post_type=ticket&p=216',0,'ticket','',0),(217,1,'2022-12-29 15:57:38','0000-00-00 00:00:00','','Borrador automático','','auto-draft','closed','closed','','','','','2022-12-29 15:57:38','0000-00-00 00:00:00','',0,'http://circum.cl/?post_type=ticket&p=217',0,'ticket','',0),(218,1,'2022-12-29 16:01:51','0000-00-00 00:00:00','','Borrador automático','','auto-draft','closed','closed','','